import React, { useState } from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  const heros = ['calbonm', 'lanbon', 'makzji']
  const herosAge = ['30','40','80']
  return (
    <div className="App">
      <header className="App-header">
      <div>
        <MovieCount></MovieCount>
      <Hero name="kelvin"></Hero>
      <Hero name={heros[1]} age="30"></Hero>
      <Hero name="Zelvin" age={herosAge[2]}></Hero>
      <Hero ></Hero>


      </div>
      </header>
    </div>
  );
}
function MovieCount(){
  const[count, setCount] = useState(5);
  console.log(count);
  return(
  <div>
    <button>Add Movie</button>
  <h3>Number of movie:{count}</h3>
  </div>
  );
}
function Hero(props){
  // console.log(props.name)
  const heroStyle= {
    border:'2px solid salmon',
    padding:'5px',
    margin:'10px',
    float:'left'

  }
  return (
    <div style={heroStyle}>
      <h2>I m Developer:{props.name || "jack"}</h2>
      <h3>Developer Age:{props.age || 40} years </h3>
    </div>
  );
}
export default App;
